&lt;p&gt;&lt;a href="http://decluttr.com/4714069020" rel="nofollow"&gt;LARGE&lt;/a&gt;&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
You can find this street artist at the Djemaa el Fna square in the old city of Marrakech, Medina. The only trick he has is the miracle hats, which seem to wonder off by themselves. Of course the real artists are the guinea pig and the hedgehog who walk around under the hats. All the other animals are just there for the entourage. Another must see if you visit Marrakech! &lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
Feel free to use this image as you wish! I only ask you to credit me by linking back to my flickr account or my website &lt;a href="http://www.archetypefotografie.nl/" rel="nofollow"&gt;www.archetypefotografie.nl/&lt;/a&gt; Thanks! &lt;br /&gt;
&lt;br /&gt;
If you wanna follow me on Twitter -&amp;gt; &lt;a href="http://twitter.com/AF_Photography" rel="nofollow"&gt;twitter.com/AF_Photography&lt;/a&gt;&lt;br /&gt;
