&lt;p&gt;&lt;a href="http://www.flickr.com/photos/superdewa/4723641160/" title="183/365: eyes too bright"&gt;&lt;img src="http://farm2.static.flickr.com/1094/4723641160_c28d7bc897_m.jpg" width="240" height="171" alt="183/365: eyes too bright" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;She woke up to sad news this morning. We had all grown attached to our neighbor's new chickens, but her especially. She has an extra soft spot in her heart for animals, and she'd even gotten to name two of the the chickens. This morning we learned that 4 out of 6 of them, including the two she'd named, had been killed over the weekend. It was probably a weasel or a raccoon. She was devastated, of course. &lt;br /&gt;
&lt;br /&gt;
She's smiling here, but I can see her eyes are too bright and her smile is forced. I feel so sad for her.&lt;/p&gt;

