&lt;p&gt;&lt;a href="http://www.flickr.com/photos/r_w_grant/4725804161/" title="Chicken shack"&gt;&lt;img src="http://farm2.static.flickr.com/1237/4725804161_e66a24c3eb_m.jpg" width="240" height="184" alt="Chicken shack" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The chicken (Gallus gallus domesticus) is a domesticated fowl.&lt;br /&gt;
As one of the most common and widespread domestic animals, and with a population of more than 24 billion in 2003, there are more chickens in the world than any other bird.  Humans keep chickens primarily as a source of food, consuming both their meat and their eggs.&lt;br /&gt;
&lt;br /&gt;
Conventional wisdom has held that the chicken was domesticated in India, but recent evidence suggests that domestication of the chicken was already under way in Vietnam over 10,000 years ago.&lt;br /&gt;
&lt;br /&gt;
From India the domesticated fowl made it's way to the Persianized kingdom of Lydia in western Asia Minor, domestic fowl were imported to Greece by the fifth century BC.&lt;br /&gt;
&lt;br /&gt;
Fowl had been known in Egypt since the 18th Dynasty, with the &amp;quot;bird that lays every day&amp;quot;  having come to Egypt from the land between Syria and Shinar, Babylonia, according to the annals of Tutmose III.&lt;/p&gt;

