&lt;p&gt;&lt;a href="http://www.flickr.com/people/romair/"&gt;Romair&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/romair/4796842428/" title="Egg Laying Nest (before the days of assembly line factory farming)"&gt;&lt;img src="http://farm5.static.flickr.com/4141/4796842428_75b0ec93eb_m.jpg" width="240" height="218" alt="Egg Laying Nest (before the days of assembly line factory farming)" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;This photo, which I took in 1992, thirty years after the family egg business ceased operation, is of the back side of some of the many egg laying nests used on the poultry farm on which my wife Sammy was raised (the chickens entered from the other side of this, but unfortunately I don't have a shot of the front). When I was about to post this photo for inclusion in my &lt;a href="http://www.flickr.com/photos/romair/sets/72157605681479338/"&gt;Family Farm Set&lt;/a&gt;, I wrote to Sammy's brother Lem and asked for his memories of this key feature of the family poultry business, and true to form, Lem came through with some wonderful details about the operation.  Following, are his words, and if you have any interest at all in learning how the egg business was run back in the days before assembly line factory farms took over, read on.  It's well written and you'll enjoy reading it. &lt;br /&gt;
&lt;br /&gt;
&lt;i&gt;.... the hens would enter from the other side (&amp;quot;hen house side&amp;quot;) into this rather dark nest and do their duty, namely laying  an egg, usually one a day during their peak productivity. After laying the egg, they usually left the nest. In &amp;quot;rush hour&amp;quot;, typically from 8 AM to noon, the  hens would line up outside the egg laying box like at a deli counter- as one hen left the nest, the next one in line would hop in. There were 2 amazing things about this activity: The first was that the hens did not have to be trained to lay their eggs in the nest; it had been bred into them to seek a dark hole in a big room. We rarely if ever  found an egg on the hen house floor. The second thing was that the hens were able to hold laying their egg while waiting outside the nest until space opened up in the nest. During rush hour the hens were packed in like a  subway at 5PM (body to body). &lt;br /&gt;
&lt;br /&gt;
Then there were hens that were collecting eggs underneath their wings. With some hens, they laid eggs for a few weeks but then went into a brooding cycle, much like birds do in the wild. Once one has enough eggs, such birds would sit on them to try to make them hatch which, would take 21 days if the eggs were fertile (unlikely on this farm since there were no roosters around). This caused three problems from a farmer's point of view: 1) After starting to &amp;quot;brood,&amp;quot; the hen would no longer lay eggs while still consuming resources (i.e. chicken feed and a house to live in); 2) these birds were taking up valuable space in a nest when they should be laying eggs and not collecting them, and 3) some of the &amp;quot;brooders&amp;quot; put up a stiff fight if one tried to collect the eggs under them. They would peck one with their beak, trying to grasp some flesh. If successful, they would then twist their beak, often bruising one pretty badly and occasionally  breaking one's skin. Fighting to get these eggs would take up valuable chore time. Since we (children on the farm) were paid on a piece basis (work accomplished, not an hourly rate) these brooders were taking up our valuable time,   Needless to say, such unproductive trouble makers met their judgment day pretty fast, since us kids tattled on these birds pretty fast to our father, and he would put them in a cage for a one way trip to the &amp;quot;big city,&amp;quot; much like sheriffs  in Westerns packed the bad guys out of town on the next train.&lt;/i&gt;&lt;/p&gt;

