&lt;p&gt;There's a small restaurant near campus (well, about a 40-minute walk away, but it was the closest we had) called My-Chosen Cafe. Outside the restaurant, there's a little space where they raise chickens and goats — obviously, I was enthralled, even all these years later, by the beautiful animals.&lt;br /&gt;
&lt;br /&gt;
&lt;em&gt;Last month, I flew back to Victoria, British Columbia, to attend my &lt;a href="http://pearsoncollege.ca" rel="nofollow"&gt;ten-year high school reunion&lt;/a&gt;. The campus hadn't changed much, and while the people had changed a lot, it felt like we had never left. It was a wonderful week spent with friends, on the water, and in a beautifully-picturesque part of the country.&lt;/em&gt;&lt;/p&gt;

