&lt;p&gt;&lt;a href="http://www.flickr.com/photos/criselda/5073972327/" title="survivors of late summer"&gt;&lt;img src="http://farm5.static.flickr.com/4055/5073972327_99f4845fa9_m.jpg" width="240" height="206" alt="survivors of late summer" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;These are the chicks that I picked up at USPS on Tuesday, Sept. 21st around 4pm. The USPS tried to deliver them personally at 11am, but I wasn't home; unfortunately one (pictured Sept 22nd ) didn't make it. These are the survivors and it shows! They are 2-3 weeks old. The nearest chick is a Silver Spangled Hamburg, a very old breed, originally from Holland. They lay white eggs and perhaps you can see from the photo, Hamburgesas, as we call them, are assertive. The darker variety is a rare popular breed also from Holland called Welsummer. Welsummer's lay beautiful dark brown eggs. Both are good free-rangers, 4-5 lbs. at maturity.&lt;/p&gt;
